import * as React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import { Layout, Menu, Row, Col} from "antd"
import Typography from '@material-ui/core/Typography';
import logo1 from "../../assets/images/logo1.jpeg"

import PrivateComponent from "../../pages/private"
import styles from "./styles.module.scss"

const { Header, Content, Footer } = Layout;

const PRouter = ()=>{
  return (
    <Router>
      <>
        <Route exact={true} path="/private" component={PrivateComponent} />
        <Route render={() => <Redirect to="/private" />} />
      </>
    </Router>
  )
}

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright © Ceramic Milano '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}


class PrivateRouter extends React.Component {
  render() {
    return (
      <Layout className={`${styles.mainLayout} layout`}>
        <Header className={styles.header}>
          <Row>
          <Col span={24} className={styles.main_top_bar}>
            <Col span={1} className={styles.logo_container + " "+ styles.logo}>
              <img src={logo1} alt="logo" />
            </Col>
            <Col className={styles.menu_items_container}>
              <div className={styles.menu_item_container}>
                <p className={styles.menu_item}>Operations</p>
              </div>
              <div className={`${styles.menu_item_container}  ${styles.menu_item_container_selected}`}>
                <p className={`${styles.menu_item}`}>Executive</p>
              </div>
              <div className={`${styles.menu_item_container} ${styles.menu_item_container_last}`}>
                <p className={styles.menu_item}>BrewKnowledge<span>TM</span></p>
              </div>
            </Col>

          </Col>
        </Row>
        </Header>
        <Content style={{ padding: '0 50px' }}>
          <div className="site-layout-content">
            <PRouter />
          </div>
        </Content>
        <Footer style={{ textAlign: 'center' }}><Copyright /></Footer>
      </Layout>
    );
  }
}

export default PrivateRouter ;
